import React from 'react';



import '../style/winLoseDraw.css';
import Score from './Score';

const WinLoseDraw = (props) => {

    const test = () => {
        console.log(props.winLoseDraw);
    }



    return (
        <div className={props.winLoseDraw} onClick={test}>
            {props.winLoseDraw}
        </div>
    )


}

export default WinLoseDraw;
